import React , {Component} from 'react'
import NewPeer from './NewPeer'
export default class Wrtc extends Component {
    state= {
        rtcPeerConn:[],
        sendDataChannel:[],
        catchDataChannel:[]
    }

    render(props){

        return(
            <div>                
                <NewPeer rtcPeerConn = {this.state.rtcPeerConn}
                sendDataChannel = {this.state.sendDataChannel}
                catchDataChannel={this.state.catchDataChannel} 
                socket = {this.props.socket}
                peer_id={props.peer_id}/>
            </div>
        )

    }

}
